import React from 'react';

import './xzoom';
import './xzoom.min';

import './product.css';
import './xzoom.css';

export const Product = () => {

    
    return (
        <>
            <img className="xzoom" alt="foto" src="path/to/preview_image_01.jpg" xoriginal="path/to/original_image_01.jpg" />

            <div className="xzoom-thumbs">
            <a href="path/to/original_image_01.jpg">
                <img className="xzoom-gallery" alt="foto" width="80" src="path/to/thumbs_image_01.jpg"  xpreview="path/to/preview_image_01.jpg"/>
            </a>
            <a href="path/to/original_image_02.jpg">
                <img className="xzoom-gallery" alt="foto" width="80" src="path/to/preview_image_02.jpg"/>
            </a>
            <a href="path/to/original_image_03.jpg">
                <img className="xzoom-gallery" alt="foto" width="80" src="path/to/preview_image_03.jpg"/>
            </a>
            <a href="path/to/original_image_04.jpg">
                <img className="xzoom-gallery" alt="foto" width="80" src="path/to/preview_image_04.jpg"/>
            </a>
            </div>

        </>
    )
}
